import {Col, Container, Row} from 'react-bootstrap'

function Register() {
    return (
        <Container>
            <Row className='justify-content-md-center mt-5 '>
                <Col md={6} className='bg-dark'>
                    Ciao
                </Col>
            </Row>
        </Container>
    )
}

export default Register
